  abrirClientes(){
    this._ruc = 'R.U.C'
    this._dni = 'D.N.I'
    const dialogConfig  = new MatDialogConfig()
    dialogConfig.disableClose = true
    dialogConfig.autoFocus = true
    dialogConfig.width = "100%"
    dialogConfig.height = "90%"
    const dialogRef = this.dialog.open(ClientesComponent, dialogConfig)

    dialogRef.afterClosed().subscribe(result =>{
      if(result == false){
      }else{
        this.clientes = result as Clientes[]
        const data:any = this.clientes
        this.clienteSeleccion = result
        if(data.tipo_documento === 'D.N.I'){
          this._id = data.id_clientes
          this._nombrecompleto = data.nombres + ' ' + data.apellidos
          this._dni = data.numero_documento
          this._direccion = data.direccion
          this._telefono = data.telefono
          this._celular = data.celular
        }else{
          this._id = data.id_clientes
          this._nombrecompleto = data.nombres + ' ' + data.apellidos
          this._ruc = data.numero_documento
          this._direccion = data.direccion
          this._telefono = data.telefono
          this._celular = data.celular
        }
      }
    })
  }
